import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Home from "./components/Home";
import Prediction from "./components/Prediction";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Ticket from "./components/Ticket";
import Statistics from "./components/Statistics";
import CustomModel from "./components/CustomModel";
import Admin from "./components/Admin";
import JiraScripts from "./components/JiraScripts";
import ImsScripts from "./components/ImsScripts";
import CreateAS from "./components/CreateAS";
import history from "./history";

function App() {
  return (
    <React.Fragment>
      <Router history={history}>
        <Switch>
          <Route exact path="/" render={() => <Home cisco={false} />} />
          <Route
            exact
            path="/prediction/"
            render={() => <Prediction mesaj={"salut"} />}
          />
          <Route exact path="/ticket" component={Ticket} />
          <Route exact path="/statistics" component={Statistics} />
          <Route exact path="/custom/model" component={CustomModel} />
          <Route exact path="/admin" component={Admin} />
          <Route exact path="/jirascripts" component={JiraScripts} />
          <Route exact path="/imsscripts" component={ImsScripts} />
          <Route exact path="/jirascripts/script1" component={CreateAS} />
                        {/* script1= component CreateAS */}
        </Switch>
      </Router>
    </React.Fragment>
  );
}

export default App;
